import React from "react";
import Style from "./registrationForm.module.scss";
import {
  ColFields,
  ImageSelector,
  TextArea,
  Buttons,
  Title,
  FormFields,
} from "../../formFields";

export default function RegistrationForm() {

  function handleSubmit(e){
    e.preventDefault();

    const data = {
      
    }
  }
  return (
    <>
      <div className={Style.container}>
        <div className={Style.form__container}>
          <label className={Style.form__title__field}>
            <Title title={"Cadastro de veículos"} Style={Style} />
            <form className={Style.form__field}>
              <div className={Style.form}>
                <FormFields
                  name={"NomeVeiculo"}
                  placeholder={"Nome do Veiculo"}
                />
                <FormFields name={"Fabricante"} placeholder={"Fabricante"} />
                <FormFields name={"Modelo"} placeholder={"Modelo"} />
                <FormFields name={"Ano"} placeholder={"Ano"} />
              </div>
              <div className={Style.form}>
                <div className={Style.form__media}>
                  <FormFields name={"Câmbio"} placeholder={"Câmbio"} />
                  <ColFields
                    name={"Potência"}
                    placeholder={"Potência"}
                    Style={Style}
                    unidadeMedida={"CV"}
                  />
                </div>
                <div className={Style.form__media}>
                  <ColFields
                    name={"Torque"}
                    placeholder={"Torque"}
                    Style={Style}
                    unidadeMedida={"N.m"}
                  />
                  <FormFields name={"KM"} placeholder={"KM"} />
                </div>
              </div>
              <div className={Style.form}>
                <FormFields name={"Cor"} placeholder={"Cor"} />
                <FormFields name={"Cabine"} placeholder={"Cabine"} />
                <FormFields
                  name={"RelacaoDiferencial"}
                  placeholder={"Relação diferencial"}
                />
                <FormFields name={"Suspensão"} placeholder={"Suspensão"} />
              </div>
              <div className={Style.form}>
                <div className={Style.form__media}>
                  <FormFields name={"EntreEixos"} placeholder={"Entre-eixos"} />
                  <FormFields name={"Placa"} placeholder={"Placa do veículo"} />
                  <ColFields
                    name={"CapMaxCombustível"}
                    placeholder={"Cap. máx. combustível"}
                    Style={Style}
                    unidadeMedida={"L"}
                  />
                </div>
                <ColFields
                  name={"Preço"}
                  placeholder={"Valor"}
                  Style={Style}
                  unidadeMedida={"R$"}
                />
              </div>
              <div className={Style.form__media__textarea}>
                <TextArea
                  name={"InfoAd"}
                  placeholder={"Informações opcionais"}
                  label={"Informações opcionais"}
                  Style={Style}
                />
                <TextArea
                  name={"InfoOp"}
                  placeholder={"Informações adicionais"}
                  label={"Informações adicionais"}
                  Style={Style}
                />
              </div>

              <div className={Style.buttons__field}>
                <ImageSelector label={"Selecionar múltiplas imagens"} />
                <Buttons
                  type={"reset"}
                  variant={"outline-danger"}
                  name={"Limpar"}
                />{" "}
                <Buttons
                  type={"submit"}
                  variant={"outline-success"}
                  name={"Cadastrar"}
                />
              </div>
            </form>
          </label>
        </div>
      </div>
    </>
  );
}
